      "content": "org.wikipedia\n.main.MainActivity\n69dbe10bd875b1752828653fe462f028\norg.wikipedia:id/action_bar_root,org.wikipedia:id/container,org.wikipedia:id/link_preview_extract,org.wikipedia:id/link_preview_thumbnail_gallery,org.wikipedia:id/link_preview_secondary_button,org.wikipedia:id/dialog_link_preview_container,org.wikipedia:id/coordinator,org.wikipedia:id/gallery_thumbnail_image,org.wikipedia:id/touch_outside,org.wikipedia:id/link_preview_title,org.wikipedia:id/link_preview_toolbar,org.wikipedia:id/link_preview_primary_button,org.wikipedia:id/design_bottom_sheet,org.wikipedia:id/link_preview_tertiary_button,org.wikipedia:id/link_preview_thumbnail,org.wikipedia:id/dialog_link_preview_content_container,org.wikipedia:id/link_preview_overflow_button,android:id/content\nNull Island,GET DIRECTIONS,READ ARTICLE,OPEN IN NEW TAB,Null Island is a name for the area around the point where the prime meridian and the equator cross, located in the Gulf of Guinea off the west African coast. In the WGS84 datum, this is at zero degrees latitude and longitude, and is the location of a buoy. The name 'Null Island' serves as both a joke based around the suppositional existence of an island there, and also as a name to which coordinates erroneously set to 0,0 are assigned in placenames databases in order to more easily find and fix them. The nearest land is the coast of Ghana, between Akwidaa and Dixcove at 4\u00b045\u203230\u2033N 1\u00b058\u203233\u2033W, 569\u00a0km (354\u00a0mi) away.\n\n"
